using System;
using System.Collections.Generic;
using System.Drawing;
using System.IO;
using System.Linq;
using System.Runtime.Serialization.Formatters.Binary;
using System.Text;
using System.Threading.Tasks;

namespace LiveSplit.LinkToThePast
{
    /// <summary>
    /// Icons for LiveSplit
    /// </summary>
    class SplitIcons : Dictionary<String, Image>
    {
        public SplitIcons()
        {
            this["Hyrule Castle"] = Decode("");
            this["Eastern Palace"] = Decode("");
            this["Desert Palace"] = Decode("");
            this["Tower of Hera"] = Decode("");
            this["Hyrule Castle Tower"] = Decode("");
            this["Palace of Darkness"] = Decode("");
            this["Thieves' Town"] = Decode("");
            this["Skull Woods"] = Decode("");
            this["Ice Palace"] = Decode("");
            this["Swamp Palace"] = Decode("");
            this["Misery Mire"] = Decode("");
            this["Turtle Rock"] = Decode("CDATA[");
            this["Ganon's Tower"] = Decode("");
            this["Ganon"] = Decode("");
        }

        private Image Decode(String base64String)
        {
            var bf = new BinaryFormatter();
            var data = Convert.FromBase64String(base64String);

            using (var ms = new MemoryStream(data))
            {
                return (Image)bf.Deserialize(ms);
            }
        }
    }
}
